const { alldl } = require('@saxx/no-noobs-apis');
const { shortenURL, getStreamFromUrl } = global.utils;

module.exports = {
  config: {
    name: "alldl",
    aliases: ["dl", "alldown"],
    author: "Mesbah Saxx",
    description: {
      en: "Download videos from Facebook, TikTok, Instagram, YouTube, and over 700+ sites",
      vi: ""
    },
    countDown: 5,
    category: "media",
    guide: {
      en: "{pn} <video_url | reply_with_shared_video>",
      vi: ""
    }
  },
  onStart: async function({ message, event, args }) {
    const { reply, reaction, unsend } = message;
    if (!(await validateAuthor(this.config.author))) return;
    let videoUrl;

    if (event.messageReply && event.messageReply.attachments && event.messageReply.attachments[0]) {
      videoUrl = args.join(" ") || (event.messageReply.body.includes('tiktok.com') ? event.messageReply.body : event.messageReply.attachments[0].url);
    } else {
      videoUrl = args.join(" ");
    }

    try {
      if (!videoUrl) {
        const msg = await reply("Please provide a valid video link.");
        setTimeout(() => unsend(msg.messageID), 30000);
        return;
      }

      const validUrls = videoUrl.match(/https?:\/\/[^\s]+/);
      if (validUrls && validUrls.length > 0) {
        await reaction("â³", event.messageID);
        let videoData;

        if (videoUrl.includes("youtube.com") || videoUrl.includes("youtu.be")) {
          videoData = await downloadYtVideo(videoUrl);
        } else if (videoUrl.includes("tiktok.com")) {
          videoData = await downloadTikTok(videoUrl);
        } else {
          videoData = await downloadVideo(videoUrl);
        }

        const { uploader, title, source, download_url } = videoData;
        const shortUrl = await shortenURL(download_url);
        const attachment = await getStreamFromUrl(download_url, `${title}.mp4`);

        await reaction("âœ…", event.messageID);
        await reply({
          body: `Uploader: ${uploader}\n\nSource: ${source}\n\nTitle: ${title}\n\nDownload Link: ${shortUrl}`,
          attachment
        }, (err) => {
          if (err) {
            reply("Media Ban or Bot couldn't send the video. Use the download link: \n" + shortUrl);
          }
        });
      }
    } catch (err) {
      await reaction("ðŸ’”", event.messageID);
      await reply(`Error: ${err.message}`);
    }
  }
};

